import React from 'react';
import Link from 'next/link';

function Navbar() {
  return (
    <div>
      <Link href='/'>HOME</Link>
      <Link href='/signup'>SIGNUP</Link>
      <Link href='/login'>LOGIN</Link>
    </div>
  );
}

export default Navbar;
